import React from 'react';


const SocialMedia= () => {
    return (
        <nav className='socialmedia_icon'>
            <p>Follow olympics on </p>
            <a class='fa fa-facebook' href="https://www.facebook.com/olympics/" target="_blank" ></a>    
            <a  class="fa fa-twitter" href="https://twitter.com/Olympics"  target="_blank"> </a>    
            <a class="fa fa-instagram" href="https://www.instagram.com/Olympics/"  target="_blank"> </a>    
            <a class="fa fa-snapchat-ghost" href="https://www.snapchat.com/add/olympics"  target="_blank"></a> 
            <a  class="fa fa-youtube" href="https://www.youtube.com/olympics"  target="_blank"></a>
            <a></a>

        </nav>
    )
};
export default SocialMedia;
